import React from 'react';

import {
  Box,
  Container,
  Button,
  Grid,
  Paper,
  Typography,
  TextField,
  MenuItem,
  FormControl,
  FormLabel,
  FormControlLabel,
  RadioGroup,
  Radio,
} from '@mui/material';
import { makeStyles } from '@material-ui/core';

import { XYPlot, ArcSeries } from 'react-vis';

const Graph = ({ macroBreakdown }) => {
  const PI = Math.PI;

  const myData = [
    { angle0: 0, angle: Math.PI / 4, opacity: 0.2, radius: 2, radius0: 1 },
    { angle0: PI / 4, angle: (2 * PI) / 4, radius: 3, radius0: 0 },
    { angle0: (2 * PI) / 4, angle: (3 * PI) / 4, radius: 2, radius0: 0 },
    { angle0: (3 * PI) / 4, angle: (4 * PI) / 4, radius: 2, radius0: 0 },
    { angle0: (4 * PI) / 4, angle: (5 * PI) / 4, radius: 2, radius0: 0 },
    { angle0: 0, angle: (5 * PI) / 4, radius: 1.1, radius0: 0.8 },
  ];
  return (
    <Box>
      <h1>Graph Placeholder</h1>
      <p>{`Carbs: ${macroBreakdown.carbs}`}</p>
      <p>{`Protien: ${macroBreakdown.protien}`}</p>
      <p>{`Fat: ${macroBreakdown.fat}`}</p>

      <XYPlot xDomain={[-5, 5]} yDomain={[-5, 5]} width={300} height={300}>
        <ArcSeries
          animation
          radiusType={'literal'}
          center={{ x: -2, y: 2 }}
          data={myData}
          colorType={'literal'}
        />
      </XYPlot>
    </Box>
  );
};

export default Graph;
